import React from 'react';
import PropTypes from 'prop-types';

import '../../styles/ElectionModal.css';
import '../../styles/ElectionModalReviewPage.css';

const propTypes = {
    election: PropTypes.object,
    selectedOption: PropTypes.number,
    show: PropTypes.bool,
};

const defaultProps = {
    election: {},
    selectedOption: null,
    show: false,
};

function ElectionModalReviewPage(props) {
    const {
        election,
        selectedOption,
        show
    } = props;

    const modalVisibility = show ? "visible" : "hidden";
    const animation = show ? " animate-review-in" : "";
    console.log(modalVisibility); 
    console.log(animation);

    return (
        <div className={`election-modal-review-page-container ${animation}`} style={{ visibility: {modalVisibility} }}>
            <div className="election-modal-review-title">
                Review Your Vote
            </div>
        </div>
    );
}

ElectionModalReviewPage.propTypes = propTypes;
ElectionModalReviewPage.defaultProps = defaultProps;
export default ElectionModalReviewPage;
